import { Link } from 'react-router-dom';

import image from '../asset/image.png';
import './HomePage.css';

function HomePage () {
  return (
    <div className="container-homepage">
      <header className="app-header">
        <img className="logo-homepage" src={image} alt="image" />
          <h4 className="text-homepage">Relax. Chill. Discover gooooood music.</h4>
            <p className="intro-homepage">
              Welcome to Bandgangs, an innovative way to listen to music, discover artists, only providing you
              with the cream of the crop. Let yourself drop in this thrilling and sensory experience.
            </p>
        <Link to='/home'>
          <div className="arrow">
            <a href="#section-home"></a>
          </div>
        </Link>
      </header>
    </div>
  );
}
export default HomePage;
